class Pixel(object):
    """init"""
    def __init__(self, x = -1, y = -1, tot = -1, toa = -1, count = -1, index = -1):
        super(Pixel, self).__init__()

        self.x = x
        self.y = y
        self.index = index
        self.toa = toa
        self.tot = tot
        self.count = count

        self.cons_init()

    def cons_init(self):
        if self.index == -1 and self.x != -1 and self.y != -1:
            self.index = self.x + 256*self.y

    def calibrate(self, cal_mat_a, cal_mat_b, cal_mat_c, cal_mat_t):
        try:
            self.tot = calib_mat([self.x, self.y, self.tot] ,cal_mat_a, cal_mat_b, cal_mat_c, cal_mat_t)
        except:
            print("Fail to calibrate")

    def is_tpx3(self):
        if self.tot != -1 and (self.toa != -1 or self.count != -1):
            return True
        else: 
            return False

class Cluster(object):
    """init"""
    def __init__(self):
        super(Cluster, self).__init__()
                
        self.pixels = []
        self.pixels_np = np.array([[-1.,-1.,-1.,-1.]])

        self.calibrated = None

        self.x_vol = -1
        self.y_vol = -1
        self.x_board_min = -1
        self.x_board_max = -1
        self.y_board_min = -1
        self.y_board_max = -1
        self.energy = -1
        self.time = -1
        self.size = -1
        self.height = -1
        self.roundness = -1
        self.linearity = -1


    def add_pixel(self, pixel=None, x=-1, y=-1, tot=-1):
        if pixel:
            self.pixels.append(pixel)
        elif x != -1 and y != -1 and tot != -1:
            pixel = Pixel(x = x, y = y, tot = tot)
            self.pixels.append(pixel)


    def convert_pixels_to_numpy(self):
        
        if not self.pixels:
            raise Exception("No pixels")

        pix_dim = 4 if self.pixels[0].is_tpx3() else 3
        pixels_np = np.zeros(shape=(len(self.pixels),pix_dim), dtype=np.float64)

        for i, pixel in enumerate(self.pixels):
            pixels_np[i,0] = float(pixel.x)
            pixels_np[i,1] = float(pixel.y)
            pixels_np[i,2] = float(pixel.tot)

            if pix_dim > 3:
                if pixel.count != -1:
                    pixels_np[i,3] = float(pixel.count)   
                elif pixel.toa != -1:
                    pixels_np[i,3] = float(pixel.toa)

        pixels_np[:, 0] += 0.5
        pixels_np[:, 1] += 0.5

        self.pixels_np = pixels_np

        return pixels_np

    def get_border_pixels(self):

        if self.pixels_np[0,0] == -1.:
            self.convert_pixels_to_numpy()

        self.x_board_min = np.min(self.pixels_np[:, 0])
        self.x_board_max = np.max(self.pixels_np[:, 0])
        self.y_board_min = np.min(self.pixels_np[:, 1])
        self.y_board_max = np.max(self.pixels_np[:, 1])       

        return [self.x_board_min, self.x_board_max, self.y_board_min, self.y_board_max]


    def print(self):
        print(self.pixels)
        print(self.x_vol, self.y_vol)

    def plot(self, var_idx = 2, fig = None, ax=None, show_plot=True, file_out = ""):

        if not self.pixels:
            raise Exception("No pixels") 

        pix_dim = 4 if self.pixels[0].is_tpx3() else 3

        if var_idx >= pix_dim or var_idx <= 1:
            raise Exception("Incorrect varaible index.") 

        if self.pixels_np[0,0] == -1.:
            self.convert_pixels_to_numpy()

        if self.x_board_min == -1:
            self.get_border_pixels()    

        binx = list(range(int(self.x_board_min),int(self.x_board_max)+1))
        biny = list(range(int(self.y_board_min),int(self.y_board_max)+1))

        if self.x_board_min == self.x_board_max:
            binx = [int(self.x_board_min)]
        if self.y_board_min == self.y_board_max:
            biny = [int(self.y_board_min)]

        if fig == None or ax == None:
            fig, ax = plt.subplots()

        x_edges = self.pixels_np[:, 0].tolist()
        y_edges = self.pixels_np[:, 1].tolist()
        bin_conts = self.pixels_np[:, var_idx].tolist()

        x_edges.append(self.x_board_max+1)
        y_edges.append(self.y_board_max+1)
        bin_conts.append(0)

        binx.append(int(self.x_board_max)+1)
        biny.append(int(self.y_board_max)+1)

        hist = ax.hist2d(x_edges, y_edges, bins=(binx, biny), 
                    weights=bin_conts, cmap='viridis',cmin = 1.000000)

        #  plot range
        range_x = self.x_board_max - self.x_board_min + 1
        range_y = self.y_board_max - self.y_board_min + 1
        range_diff = abs(range_x - range_y)

        x_range_min = self.x_board_min - 1.5
        x_range_max = self.x_board_max + 1.5
        y_range_min = self.y_board_min - 1.5
        y_range_max = self.y_board_max + 1.5

        if range_y > range_x:
            x_range_min = self.x_board_min - int(range_diff/2.) - 1.5
            x_range_max = self.x_board_max + int(range_diff/2.) + 1.5                         
        if range_y < range_x:
            y_range_min = self.y_board_min - int(range_diff/2.) - 1.5
            y_range_max = self.y_board_max + int(range_diff/2.) + 1.5             

        ax.set_xlim(xmin = x_range_min, xmax = x_range_max)
        ax.set_ylim(ymin = y_range_min, ymax = y_range_max)


        cbar = fig.colorbar(hist[3], ax=ax)  # hist[3] returns the QuadMesh
        cbar.set_label('Counts')

        ax.set_xlabel('X [-]')
        ax.set_ylabel('Y [-]')

        if var_idx == 2:
            if self.is_calibrated():
                cbar.set_label('Energy [keV]')
            else:
                cbar.set_label('ToT [-]')

        ax.set_aspect('equal')

        if file_out:
            pass
        elif show_plot:
            fig = plt.gcf()
            fig.set_size_inches(6.5,5)            
            plt.show()

        return hist, cbar

    def is_calibrated(self):

        if self.calibrated != None:
            return self.calibrated

        for idx,pixel in enumerate(self.pixels):
            if pixel.tot-int(pixel.tot) > 0:
                self.calibrated = True
                return True
                break
            if idx == 5:
                break

        self.calibrated = False
        return False



    def plot_all(self, file_out = ""):
        
        if not self.pixels:
            raise Exception("No pixels") 


        pix_dim = 4 if self.pixels[0].is_tpx3() else 3

        ax_test = None

        if pix_dim == 4:
            fig, axs = plt.subplots(1, 3)

            self.plot(2, fig, axs[0], show_plot=False)
            self.plot(3, fig, axs[1], show_plot=False)

            fig = plt.gcf()
            fig.set_size_inches(17,5)

            ax_test = axs[2]
        else: 
            fig, axs = plt.subplots(1, 2)

            self.plot(2, fig, axs[0], show_plot=False)

            fig = plt.gcf()
            fig.set_size_inches(6.5, 5)

            ax_test = axs[1]

        ax_test.axis('off')
        ax_test.text(0.5, 0.5, 'Your description text', ha='center', va='center', fontsize=12, color='black')

        if file_out:
            pass
        else:
            plt.show()
        
        
    def load_from(self, cluster_str):
        
        pattern = r'\[(\d+), (\d+), ([\d.]+), ([\d.]+)\]'
        pixels_str = re.findall(pattern, cluster_str)
        
        for pixel in pixels_str:
            pix = Pixel(x=int(pixel[0]), y=int(pixel[1]), tot=float(pixel[2]), toa=float(pixel[3]))
            self.add_pixel(pix)
        
        
